import React from 'react'

function Header() {
    const HeaderButton = [
        { text: "Home", id: 1, url: "/" },
        { text: "Blog Post", id: 2, url: "/" },
        { text: "About", id: 3, url: "/" },
        { text: "Contact", id: 4, url: "/" },
    ]
    return (
        <div className="bg-gray-300 bg-cover m-auto">
            <div className="flex gap-6 justify-center items-center p-4">
                {HeaderButton.map((button) => (
                    <h1 key={button.id}>
                        <a href={button.url}>{button.text}</a>
                    </h1>
                ))}
            </div>
        </div>
    )
}

export default Header;
